import React from 'react'
import './Header.css'
import Avatar from '@material-ui/core/Avatar';
import logo from '../images/logo.jpg'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useHistory
  } from "react-router-dom";
  import {logout} from '../actions/userAction'
  import { useDispatch, useSelector } from "react-redux";
function Header() {
    const history = useHistory()
    const userLogin = useSelector((state) => state.userLogin);
    const { userInfo } = userLogin;

    const logoutHandler = () => {
      dispatch(logout());
    };



    useEffect(()=>{
        if(!userInfo){
            history.push('/')
        }
    },[history,userInfo])

    return (
        <div className='header'>
            <div className="header__left">
                <div className="header__logo">
                    <img height='80px' width='100px' src={logo}/>
                </div>
                <div className="header__links_cont">
                <Link to='/home' style={{textDecoration:'none'}} >
                    <div className="header__links">
                        <h3>Home</h3>
                    </div>
                    </Link>

                    <Link to='/allSubject' style={{textDecoration:'none'}} >
                        <div className="header__links">
                            <h3>All Subjects</h3>
                        </div>
                    </Link>
                    <Link to='/subReg' style={{textDecoration:'none'}} >
                        <div className="header__links">
                            <h3>Academic Registration</h3>
                        </div>
                    </Link>
                    <Link to='/Staff' style={{textDecoration:'none'}} >
                        <div className="header__links">
                            <h3>Staff Room</h3>
                        </div>
                    </Link>
                </div>
            </div>

            <div className="header__profile">
                <button onClick={logoutHandler} type='submit'>Logout</button>
                <Avatar src="https://scontent.ftbs5-3.fna.fbcdn.net/v/t39.30808-1/cp0/c6.0.50.50a/p50x50/232176804_1002334117299729_2903984075817219942_n.jpg?_nc_cat=106&ccb=1-5&_nc_sid=7206a8&_nc_eui2=AeHXPwKhsP6-9g48EMOh0RrxLkxlPZUMxX0uTGU9lQzFffDoimME6F3wGJZGd7rXUuK6ChOiQGwzj6rL3tDFcfsy&_nc_ohc=LhmnqobfWMYAX8iYejQ&_nc_oc=AQnT54hcEX9nqeLsSvjqp0pLts-FbaWYfFlZcr3u0rImgCMSpzVUwYsG9J1OQa9U_2g&_nc_ht=scontent.ftbs5-3.fna&oh=e092057421f08f1a306dea7ece79034b&oe=6154EB4F" />
                <div className="header__profile__info">
                    <p>Saba Marghania</p>
                </div>
            </div>
        </div>
    )
}

export default Header
